import { Router, Route, Switch } from "react-router";
import Home from './screens/Home/index';
function App() {
  return (
      <div>

          <Router>
              <Switch>
                  <Route path="/" exact component={Home} />
              </Switch>
          </Router>
      </div>
  );
}

export default App;
